import React from 'react';
import './App.css';
import Header from './Header';
import Footer from './Footer';

function App() {
  return (
            <>
              <div style={{backgroundColor:"lightblue"}}> 
                <Header/>

                  <div style={{minHeight:"430px",backgroundColor:"lightblue",marginLeft:"55px"}}>

                     <div style={{display:"flex" , justifyContent:"center",marginTop:"55px"}}>  
                       <form>

                          <input type="text" name="text" placeholder="Text" /><br/>

                          <textarea rows="5" column="5" name="content" placeholder="Enter something"/>

                       </form>
                     </div>
                           <br/><br/>
                           <p>i am</p>
                  </div>

                <Footer/>
              </div>
            </>

          );
}

export default App;
